CREATE DEFINER=`Augusto`@`%` PROCEDURE `SearchByValue`(
	_SearchInput varchar(50)
)
BEGIN
	SELECT *
    FROM user 
    WHERE user_name like CONCAT('%', _SearchInput , '%')
    or user_address like CONCAT('%', _SearchInput , '%')
    or user_cpf_cnpj = _SearchInput;
END ;;
